def generate_neighbour(args_tuple):
    (path, number_of_points, cost_matrix, starting_points, all_paths) = args_tuple
    new_neighbour = []
    inters = 0
    while (len(new_neighbour) == 0):
        (path, number_of_points, cost_matrix, starting_points, all_paths) = args_tuple
        rand = random.randint(0, 3)
        if(len(all_paths)/2<len(path)):
            rand1 = 0
            rand2 = 1
            rand3 = 0
        elif(rand == 3):
            rand1 = random.randint(0, 1)
            rand2 = random.randint(0, 1)
            rand3 = random.randint(0, 1)
        else:
            if(rand == 0):
                rand1 = 1
                rand2 = 0
                rand3 = 0
            elif(rand == 1):
                rand1 = 0
                rand2 = 1
                rand3 = 0
            elif(rand == 2):
                rand1 = 0
                rand2 = 0
                rand3 = 1

        inters+=1

        if rand1:
            # cut a segment out of the path
            start_point = random.choice(starting_points)
            temp = np.array(path)
            list_of_indexies = np.where(temp == start_point)[0]
            if (len(list_of_indexies) > 0):
                start_index = random.choice(list_of_indexies)
                end_index = start_point+1
                while end_index < len(path):
                    if path[end_index] in starting_points:
                        if start_index == 0 and end_index == len(path)-1:
                            break
                        if (start_index == 0 and end_index != 0):
                            new_neighbour = list(path[end_index:])
                        elif (start_index != 0 and end_index == 0):
                            new_neighbour = list(path[:start_index])
                        elif (start_index == 0 and end_index == 0):
                            # new_neighbour = list(path[:start_index])
                            break
                        else:
                            new_neighbour = list(np.append(list(path[:start_index]), path[end_index:]))
                        # print(new_neighbour)
                        if(isinstance(new_neighbour[0],float)):
                            new_neighbour=[]
                        break
                    end_index += 1
        
        if len(new_neighbour)>0:
            path = new_neighbour


        if rand2:
            # add a new segment
            start = random.choice(starting_points)
            result = [start]
            current_node = random.choice([(x, y) for (x, y) in all_paths if x == start])[1]
            result.append(current_node)

            while current_node not in starting_points:
                junction = [(x, y) for (x, y) in all_paths if x == current_node and y != result[-2]]  # TODO add a bit of randomness
                if (len(junction) != 0 and random.randint(1, 2) == 1):
                    current_node = random.choice(junction)[1]
                else:
                    junction = [(x, y) for (x, y) in all_paths if x == current_node]
                    current_node = random.choice(junction)[1]
                result.append(current_node)
            new_neighbour = list(np.append(path, result))

        if len(new_neighbour)>0:
            path = new_neighbour

        if rand3:
            # modify a segment
            i = 0
            while i < 100:
                start_index = random.randint(0, len(path)-1)
                i += 1
                if (len([(x, y) for (x, y) in all_paths if x == path[start_index]]) > 2):
                    break
            else:
                continue
            end_index = start_index+1
            if (end_index >= len(path)):
                continue
            while end_index < len(path):
                if path[end_index] in starting_points:
                    break
                end_index += 1
            junction = [(x, y) for (x, y) in all_paths if x == path[start_index] and y != path[start_index+1]]  # TODO add a bit of randomness

            result = [path[start_index], random.choice(junction)[1]]
            current_node = result[0]
            while current_node not in starting_points:
                junction = [(x, y) for (x, y) in all_paths if x == current_node and y != result[-2]]  # TODO add a bit of randomness
                if (len(junction) != 0 and random.randint(1, 2) == 1):
                    current_node = random.choice(junction)[1]
                else:
                    junction = [(x, y) for (x, y) in all_paths if x == current_node]
                    current_node = random.choice(junction)[1]
                result.append(current_node)
            
            new_neighbour = list(np.append(np.append(path[:start_index], result), path[end_index:]))
            if(isinstance(new_neighbour[0],float)):
                new_neighbour=[]
  #. print(new_neighbour)
    # print(rand, eval_solution(new_neighbour, all_paths_no_dupes))
    # print(rand)
    # print(inters)
    # print("done!")
    return new_neighbour

